import Footer from "../FooterWeb.js/Footer";
import Menu from "../MenuWeb/Menu";
import DangKy_ from "./DangKy";

const DangKy = () =>{
    return(
        <div>
            <Menu />
            
            <div style={{height: '500px', justifyContent: 'center', alignItems: 'center'}} >
                <DangKy_ />
            </div>
            <Footer/>
        </div>
    );
}
export default DangKy;
